Insert into FAQ (FAQ_NUM,FAQ_TITLE,FAQ_CONTENT,FAQ_DATE,MANAGER_ID,CATEGORY_NAME) values (2,'비밀번호 찾기는 어떻게 하나요?','로그인 창 하단의 아이디/비밀번호 찾기 버튼을 누르신 후 아이디를 입력하시면 가입시 등록한 메일주소로 임시번호가 발송됩니다.',to_timestamp('17/01/26 11:42:23.844000000','RR/MM/DD HH24:MI:SSXFF'),'admin','회원정보');
