Insert into FAQ (FAQ_NUM,FAQ_TITLE,FAQ_CONTENT,FAQ_DATE,MANAGER_ID,CATEGORY_NAME) values (23,'프로필 사진을 없애고 싶어요','프로필 사진 변경 창에서 프로필사진 선택 안함을 체크 하신후 변경을 누르시면 됩니다.',to_timestamp('17/02/10 14:50:51.212000000','RR/MM/DD HH24:MI:SSXFF'),'admin','회원정보');
Insert into FAQ (FAQ_NUM,FAQ_TITLE,FAQ_CONTENT,FAQ_DATE,MANAGER_ID,CATEGORY_NAME) values (25,'내 정보를 수정하고 싶어요','마이페이지에서 자신이 변경하고 싶은 정보 옆에 있는 버튼을 눌러 해당 정보를 변경하신후 수정 버튼을 누르시면 됩니다.',to_timestamp('17/02/10 14:53:01.511000000','RR/MM/DD HH24:MI:SSXFF'),'admin','회원정보');
