Insert into FAQ (FAQ_NUM,FAQ_TITLE,FAQ_CONTENT,FAQ_DATE,MANAGER_ID,CATEGORY_NAME) values (26,'마이페이지는 어디에 있나요?','우측 상단에 위치한 회원님의 아이디를 클릭하시면 마이페이지로 이동합니다.',to_timestamp('17/02/10 14:53:24.850000000','RR/MM/DD HH24:MI:SSXFF'),'admin','회원정보');
