Insert into FAQ (FAQ_NUM,FAQ_TITLE,FAQ_CONTENT,FAQ_DATE,MANAGER_ID,CATEGORY_NAME) values (29,'이벤트 참여는 어떻게 하나요?','이벤트 상세페이지에서 참여버튼을 누르면 자동으로 참여가 완료됩니다.',to_timestamp('17/02/10 14:59:06.961000000','RR/MM/DD HH24:MI:SSXFF'),'admin','이벤트');
