Insert into MEETING_POST (POST_NUM,POST_TITLE,POST_CONTENT,POST_TAG,POST_DATE,LIKE_NUM,MEM_ID,GROUP_NUM,POST_HIT) values (202,'쑥대머리 가사','쑥대머리 귀신형용 적막
옥방으 찬자리에 생각난 것이 임뿐이라
보고지고 보고지고 보고지고 한양 낭군을
보고지고 서방님과 정별후로 일장서를 내가
못봤으니 부모봉양 글공부에 겨를이 없어서
이러는가 연인신혼 금슬우지 나를 잊고 이러는가
연인신혼 금슬우지 나를 잊고 이러는가
계궁항아 추월같이 번듯이 솟아서
비치고서 막왕막래 막혔으니 앵무서를 내가
어이보며 전전반측 잠못이르니 호접몽을
꿀수 있나 손가락에 피를 내어 사정으로
편지허고 간장의 썩은 눈물로 님의 화상을
그려볼까 일화일지 춘대우로 내눈물을 뿌렸으니
야우문령 단장성의 비만 많이 와도 임의생각
녹수부용 채련녀와 재룡망채염의 뽕따는
여인들도 낭군생각 일반이라 날보다는
좋은 팔자 옥문밖을 못나가니 뽕을 따고
연캐것나 내가 만일에 도련님을 못보고
옥중고혼이 되거드면 무덤근처 섰는 나무는
상사목이 될것이요 무덤앞에 있는 돌은 망부석이
될것이니 생전사후 이원통을 알어 줄이가
뉘 있드란 말이냐 방성통곡으 울음을 운다 ','쑥대머리,판소리',to_timestamp('17/02/17 14:22:07.198000000','RR/MM/DD HH24:MI:SSXFF'),2,'ssw',189,1);
