Insert into PRODUCT_INFO (PRODUCT_NUM,PRODUCT_NAME,PRODUCT_PRICE,PRODUCT_QTY,PRODUCT_DETAIL,SELLER_ID,PRODUCT_CAT1,PRODUCT_CAT2) values (45,'에티오피아 수프리모 커피',15000,50,'에티오피아(Ethiopia)에서는 커피를 부나(Buna) 또는 분나(Bunna)라고 부르며 반가운 손님을 맞이하거나 행사가 열릴때면 커피 세레모니(Coffee Ceremony)라하여 최고의 커피를 대접하는 의식이 남아있다. 커피를 배우고 있거나 관련된 일을 하고있는 사람이라면 한번쯤은 가보고 싶은 에티오피아(Ethiopia)는 아라비카 커피(Arabica Coffee)의 고향이자 커피가 발견될 당시의 아라비카 커피(Arabica Coffee)가 자라는 유일한 곳으로서 최고의 커피를 생산하는 국가이다.','main','식품','음료');
Insert into PRODUCT_INFO (PRODUCT_NUM,PRODUCT_NAME,PRODUCT_PRICE,PRODUCT_QTY,PRODUCT_DETAIL,SELLER_ID,PRODUCT_CAT1,PRODUCT_CAT2) values (46,'치코리타 인형',20000,50,'2세대 풀타입 스타팅 포켓몬 중 최초 형태. 주로 답이 없는 성능으로 유명하다. 속칭 잘타는 쓰레기','ssw','취미/반려동물','취미');
Insert into PRODUCT_INFO (PRODUCT_NUM,PRODUCT_NAME,PRODUCT_PRICE,PRODUCT_QTY,PRODUCT_DETAIL,SELLER_ID,PRODUCT_CAT1,PRODUCT_CAT2) values (47,'이브이 인형',20000,60,'레드의 포켓몬으로 등장. 로켓단의 실험에 의해 쥬피썬더, 샤미드, 부스터로 자유롭게 진화하거나 원래대로 돌아가는 능력이 있었지만, 에브이로 진화한 뒤에는 그 능력이 사라져버렸다.','ssw','취미/반려동물','취미');
Insert into PRODUCT_INFO (PRODUCT_NUM,PRODUCT_NAME,PRODUCT_PRICE,PRODUCT_QTY,PRODUCT_DETAIL,SELLER_ID,PRODUCT_CAT1,PRODUCT_CAT2) values (48,'윷',30000,20,'윷 가락은 각 참가자가 던지는 소품이다. 단면이 반달 모양인 네개의 가락(막대기) 또는 콩알 반쪽을 사용한다. 현대에 와서는 놀이 상품으로서의 윷은 나무막대기가 일반적이며 콩알을 파는 경우는 흔치 않다. 가락 또는 알의 둥근 면을 ''등''(또는 뒤)이라 부르고, 평평한 면을 ''배''(또는 앞)라고 부른다. 등이 나온 결과를 ''엎어졌다''라고 하고, 배가 나온 결과를 ''까졌다고'' 부른다.','ssw','취미/반려동물','기타');
Insert into PRODUCT_INFO (PRODUCT_NUM,PRODUCT_NAME,PRODUCT_PRICE,PRODUCT_QTY,PRODUCT_DETAIL,SELLER_ID,PRODUCT_CAT1,PRODUCT_CAT2) values (49,'방향제',10000,86,'방향제(芳香劑, Air Freshener)는 사람에게 향수를 뿌리듯 특정 공간에 좋은 향이 퍼지게 하여 기분을 산뜻하게 하는 약제를 일컫는다. 일상적으로는 가장 유명한 상품명대로 페브리즈라고 부르기도 한다. 관련된 물품으로는 향, 향초, 디퓨저 등이 있으며 전문 매장들도 속속 생겨나는 추세.','ssw','생활/건강',null);
Insert into PRODUCT_INFO (PRODUCT_NUM,PRODUCT_NAME,PRODUCT_PRICE,PRODUCT_QTY,PRODUCT_DETAIL,SELLER_ID,PRODUCT_CAT1,PRODUCT_CAT2) values (50,'라쿠텐 동물 인형',40000,40,'후드 부분의 입체감과 입의 위치에, 색 ? 디자인 ? 물론 꼬리 또는 외투, 리본 등 세세 한 부분을 엄선 한 디자인입니다. 크기는 어른 용의 프리 사이즈. 머리부터 다리까지 푹 저고리 매 스타일의 캐릭터와 동물에 대 변신! 또한 소매와 옷자락에 리브 확장 재질을 사용하여, 팔 다리의 방해가 되지 않고 실루엣을 표현 되어 매우 큐트!','ssw','의류/잡화','여성의류');
Insert into PRODUCT_INFO (PRODUCT_NUM,PRODUCT_NAME,PRODUCT_PRICE,PRODUCT_QTY,PRODUCT_DETAIL,SELLER_ID,PRODUCT_CAT1,PRODUCT_CAT2) values (51,'빅사이즈남자옷 봄신상니트',25000,43,'산뜻한 그린컬러의 빅사이즈남자옷 불규칙 스트라이프무늬의 니트스웨터 입니다.
봄신상답게 가볍고 산뜻하게 착용가능한 덩치큰남성의류 입니다.','ssw','의류/잡화','남성의류');
Insert into PRODUCT_INFO (PRODUCT_NUM,PRODUCT_NAME,PRODUCT_PRICE,PRODUCT_QTY,PRODUCT_DETAIL,SELLER_ID,PRODUCT_CAT1,PRODUCT_CAT2) values (52,'닥스숙녀 와인 배색 디테일 카라 티셔츠 DLE06D091WN',140000,70,'와인 컬러에 배색 카라와 배색 소매가 포인트인 티셔츠입니다. 심플하지만 밋밋하지 않은 실용적인 데일리한 아이템입니다.','ssw','브랜드패션','브랜드 여성의류');
