Insert into PRODUCT_INFO (PRODUCT_NUM,PRODUCT_NAME,PRODUCT_PRICE,PRODUCT_QTY,PRODUCT_DETAIL,SELLER_ID,PRODUCT_CAT1,PRODUCT_CAT2) values (58,'하나일 수 없는 역사',23000,74,'세계의 역사 교과서를 통해 주체적으로 읽는 20세기 세계사!

우리는 어떻게 역사를 읽고 이해해야 할까? 그동안 깊이 있는 분석과 참신한 문제제기로 현대 세계의 시사를 다루어온 르몽드 디플로마티크가 이번에는 『하나일 수 없는 역사』를 통해 역사를 어떻게 읽고 기억해야 하는지에 주목하면서 세계의 역사 교과서를 파헤쳤다. 이 책은 21개국의 중ㆍ고등학교 역사 교과서 내용을 소개함으로써 역사를 이해하는 서로 다른 시선을 제시함과 동시에 주체적인 역사 인식을 돕는다. 

현대 세계를 만든 토대가 된 19세기 산업혁명부터 다가올 미래까지 세계사의 주요 사건에 대한 서로 다른 관점을 밝혀 보이는 이 책은 기존의 상식을 뒤흔든다. 또한 21개국의 역사 교과서 서술을 비교함으로써 역사를 이해하는 다른 시선들을 소개한다. 즉, 단편적이고 보편적인 역사를 전달하는 것이 아니라, 상식에 도전하는 질문과 관점의 차이를 보여주는 서술, 사실의 검증에 필요한 다양한 자료를 통해 독자 스스로 역사를 읽고 비판하고 이해할 것을 제안한다.','main','도서/여행/e쿠폰','도서');
Insert into PRODUCT_INFO (PRODUCT_NUM,PRODUCT_NAME,PRODUCT_PRICE,PRODUCT_QTY,PRODUCT_DETAIL,SELLER_ID,PRODUCT_CAT1,PRODUCT_CAT2) values (59,'Maltese Falcon (몰타의 매)',10000,75,'Sam Spade is hired by the fragrant Miss Wonderley to track down her sister, who has eloped with a louse called Floyd Thursby. But Miss Wonderley is in fact the beautiful and treacherous Brigid O''Shaughnessy, and when Spade''s partner Miles Archer is shot while on Thursby''s trail, Spade finds himself both hunter and hunted: can he track down the jewel-encrusted bird, a treasure worth killing for, before the Fat Man finds him?','main','도서/여행/e쿠폰','도서');
